import React from 'react'
import {Counter} from 'components/index'
import {BrowserRouter as Router, Route} from 'react-router-dom'

const App = () => {
return (
  <Router>
    <Route exact path='/counter' component={Counter}/>
  </Router>
  )
}

export default App
